# 1277. Count Square Submatrices with All Ones
# 27.10.2024
# НЕ ВЫПОЛНЕНА
# def countSquares(self, matrix: List[List[int]]) -> int:

def show(matrix):
    for i in range(len(matrix)):  # len(matrix) — возвращает количество строк в матрице А
        for j in range(len(matrix[i])):  # len(matrix[i]) — возвращает количество элементов в строке i
            print(matrix[i][j], end=' ')
        print()  # делаем переход на новую строку [4](https://silvertests.ru/GuideView.aspx?id=34372)

def countSquares(matrix):
    n = len(matrix)
    m = len(matrix[0])
    result = 0
    for i in range(n):
        for j in range(m):
            if matrix[i][j] == 0:
                continue
            size = min(n, m)
            flag = False
            while size > 0 and not flag:
                if i + size > n or j + size > m:
                    size -= 1
                    continue
                sm = 0
                for k in range(i, size + i):
                    sm = sm + sum(matrix[k][j:(size + j)])
                if sm == size ** 2:
                    flag = True
                    show(matrix)
                    a = 0
                    for k in range(i, size + i):
                        matrix[k][j:(size + j - a)] = [0] * (size - a)
                        result += size - a
                        a += 1
                    size -= 1
                    continue
                size -= 1
            while size > 0:
                result += size ** 2
                size -= 1
            print(result)
            print()
    return result


